  location:
    url: "http://jenkins:8080/"
tool:
  git:
    installations:
    - home: "git"
      name: "Default"
credentials:
  system:
    domainCredentials:
    - credentials:
      - string:
          id: "m0"
          scope: GLOBAL
          secret: "{}"
jobs:
- script: >
    pipelineJob("webDemo") {
      definition {
        cpsScm {
          scriptPath 'Jenkinsfile'
          scm {
            git {
              remote { url 'https://github.com/hymian/webdemo.git' }
              branch '*/master'
              extensions {}
            }
          }
        }
      }
    }
